import React, { useEffect } from "react";

export default function Read({users}){
  
  return(
    <>
  
    <table class="table table-striped table-hover table-b mt-4">
        <thead>
            <tr>
                <th scope="col">id</th>
                <th scope="col">fullname</th>
                <th scope="col">country</th>
            </tr>
        </thead>
        <tbody>
        {users.length>0? users.map((user,key)=>(
 <tr key={key}>
 <td scope="row">{user.id}</td>
 <td>{user.fullname}</td>
 <td>{user.country}</td>
</tr>
        )):<h1 colspan="3">no users</h1>}
           
          
        </tbody>
    </table>
    </>
  )
};
